const _sfc_main = {
  name: "IndexPage",
  setup() {
    definePageMeta({
      middleware: ["guest"],
      layout: "default",
    });
    // State
    const state = reactive({
      input: {
        email: "",
        password: "",
        nsight_id: "",
        strapi_data: false,
      },
      quotes: false,
      quote: false,
      nsight_ids: false,
      errors: [],
      loading: false,
    });
    const auth = authStore();
    const runtimeConfig = useRuntimeConfig();

    // Methods
    const pull_quote = () => {
      if (state.quotes) {
        let random = Math.floor(Math.random() * state.quotes.data.length);
        state.quote = state.quotes.data[random];
      }
    };
    const quotes = async () => {
      const res = await $fetch(
        `${runtimeConfig.public.NUXT_STRAPI_URL}/api/quotes?populate=*`,
        { method: "GET" }
      )
        .then((res) => {
          state.quotes = res;
          pull_quote();
        })
        .catch((err) => {
          console.log(err);
        });
    };
    const sign_in = async () => {
      console.log("Signing in nSight member!");
      state.loading = true;
      await auth
        .login({
          identifier: state.input.email,
          password: state.input.password,
        })
        .catch((err) => {
          console.log("err", err);
          state.errors.push("Incorrect email, username, or password.");
          state.loading = false;
        });
    };

    // Created:
    quotes();

    return {
      state,
      definePageMeta,
      quotes,
      pull_quote,
      sign_in,
    };
  },
};

